import React from 'react';
import Pin from './Pin.js';
import{ Route } from 'react-router-dom';

const PinList = (props = []) => {
  return (
    <React.Fragment>
      <Route path={`/pins/${this.info.id}/edit`}>
        <PinInput
        currentPin={this.state.currentPin}
          handleSubmit={this.handleSubmit}
          handleEdit={this.handleEdit}
          hide={this.togglePinInput} />
      </Route>
      {(props.pins.length > 0)
        ? props.pins.map((x) =>
          <Pin key={x.id} info={x} delete={props.delete} togglePinInput={props.togglePinInput} browserSize={props.browserSize} />
        )
        : null }
    </React.Fragment>
  )
}

export default PinList;
